    e.preventDefault();
    setvalue(e.target.value);
    console.log("sd", e);
  }


  return (
    <div className="">
      <form action="" >
        <input type="text" onChange={handleCopy}/>

        <button> Submit</button>
      </form>

      <h3>{value}</h3>
